I have bought and sold many, many different firearms over the last year and have accumulated some accessories that I either don't use or that are for weapons I no longer own.  I will not sell these separately.  You must take everything or nothing at all. I paid well over $200 for all of this stuff.  First $60 takes it all.  Price is firm, CASH ONLY. Only trade I would consider is for a Magpul MOE buttstock/pistol grip combo in black or 300 AAC blackout ammunition.
